---

extra_includes:
- wpi/sendable/Sendable.h

classes:
  SendableRegistry:
    nodelete: true
    methods:
      GetInstance:
        return_value_policy: reference
      Add:
        overloads:
          frc::Sendable*, wpi::Twine&:
            keepalive:
            - [1, 2]
          frc::Sendable*, wpi::Twine&, int:
            keepalive:
            - [1, 2]
          frc::Sendable*, wpi::Twine&, int, int:
            keepalive:
            - [1, 2]
          frc::Sendable*, wpi::Twine&, wpi::Twine&:
            keepalive:
            - [1, 2]
      AddLW:
        overloads:
          frc::Sendable*, wpi::Twine&:
            keepalive:
            - [1, 2]
          frc::Sendable*, wpi::Twine&, int:
            keepalive:
            - [1, 2]
          frc::Sendable*, wpi::Twine&, int, int:
            keepalive:
            - [1, 2]
          frc::Sendable*, wpi::Twine&, wpi::Twine&:
            keepalive:
            - [1, 2]
      AddChild:
        overloads:
          frc::Sendable*, frc::Sendable*:
            keepalive:
            - [1, 2]
            - [2, 3]
          frc::Sendable*, void*:
            ignore: true
      Remove:
      Move:
        ignore: true
      Contains:
      GetName:
      SetName:
        overloads:
          frc::Sendable*, wpi::Twine&:
          frc::Sendable*, wpi::Twine&, int:
          frc::Sendable*, wpi::Twine&, int, int:
          frc::Sendable*, wpi::Twine&, wpi::Twine&:
      GetSubsystem:
      SetSubsystem:
      GetDataHandle:
        ignore: true
      SetData:
        ignore: true
      GetData:
        ignore: true
      EnableLiveWindow:
      DisableLiveWindow:
      GetUniqueId:
      GetSendable:
      Publish:
      Update:
      ForeachLiveWindow:
        ignore: true
  SendableRegistry::CallbackData:
    ignore: true